&quot;Human&quot; is a song by Las Vegas-based alternative rock band The Killers, and was released as the first single from the band's third studio album Day &amp; Age. It began receiving airplay on September 22, with a digital release on September 30.



In an interview with Rolling Stone magazine's Smoking Section, Brandon Flowers described &quot;Human&quot; as &quot;like Johnny Cash meets the Pet Shop Boys&quot; and confessed to not putting it on Sawdust as &quot;it was too good&quot;. There have been several mis-conceptions regarding the use and pronouncation of the word &quot;denser&quot; used in the line &quot;Are we human or are we denser?&quot; with many forum users and critics questioning Brandon Flowers' use of the word &quot;dancer&quot;.
